// Get started by creating a new React 
// component and importing the libraries!

import React from "react";
import Unity, { UnityContent } from "react-unity-webgl";

export class Patreon extends React.Component {
  constructor(props) {
    super(props);
    this.unityContent = new UnityContent(
      "MyGame/Build/Game.json",
      "MyGame/Build/UnityLoader.js"
    );
  }
  onClick() {
    this.unityContent.send(
      "SpawnController", 
      "SpawnEnemies", 
      10
    );
  }

  render() {
    return (
      <div>
        <button onClick={this.onClick.bind(this)}>Start!</button>
            <Unity unityContent={this.unityContent} />
      </div>
    );
  }
}

export default Patreon;
